*/

// prop-types is a library for typechecking of props
import PropTypes from "prop-types";

// @mui material components
import Card from "@mui/material/Card";
import Grid from "@mui/material/Grid";

// Soft UI Dashboard PRO React components
import SuiBox from "components/SuiBox";
import SuiTypography from "components/SuiTypography";

function WheatherCard({ color, title, wheather, icon }) {
  return (
    <Card>
      <SuiBox
        backgroundColor={color}
        p={2}
        display="flex"
        justifyContent="space-between"
        alignItems="center"
        backgroundGradient
      >
        <Grid container spacing={2} alignItems="center">
          <Grid item xs={8} className="line-height-0">
            <SuiTypography
              variant="button"
              textColor={color === "light" ? "dark" : "white"}
              textTransform="capitalize"
              fontWeight="medium"
              opacity={0.7}
            >
              {title}
            </SuiTypography>
            <SuiTypography
              variant="h5"
              textColor={color === "light" ? "dark" : "white"}
              fontWeight="bold"
            >
              {wheather.location} - {wheather.degree}&deg;C
            </SuiTypography>
          </Grid>
          <Grid item xs={4}>
            <SuiBox display="flex" flexDirection="column" alignItems="center">
              <SuiBox
                component="img"
                src={icon.component}
                width="50%"
                ml="auto"
                alt="wheather icon"
              />
              <SuiBox ml="auto" mr={1}>
                <SuiTypography
                  variant="h5"
                  textColor={color === "light" ? "dark" : "white"}
                  textTransform="capitalize"
                >
                  {icon.text}
                </SuiTypography>
              </SuiBox>
            </SuiBox>
          </Grid>
        </Grid>
      </SuiBox>
    </Card>
  );
}

// Setting default values for the props of WheatherCard
WheatherCard.defaultProps = {
  color: "info",
};

// Typechecking props for the WheatherCard
WheatherCard.propTypes = {
  color: PropTypes.oneOf(["primary", "secondary", "info", "success", "warning", "error", "dark"]),
  title: PropTypes.string.isRequired,
  wheather: PropTypes.shape({
    location: PropTypes.string.isRequired,
    degree: PropTypes.oneOfType([PropTypes.string, PropTypes.number]).isRequired,
  }).isRequired,
  icon: PropTypes.shape({
    text: PropTypes.string.isRequired,
    component: PropTypes.string.isRequired,
  }).isRequired,
};

export default WheatherCard;
